import { Component } from "react";
import React from "react";
import { Helpers, SimpleGrid, PageMain } from "core";
import NotificationSystem from "react-notification-system";
import Constants from '../../utils/constants';
import { Backward, GetUrl, HandleError } from "../../utils/generals";

export default class RegisterStrLogListPage extends Component
{
    constructor(props)
    {
        super(props);
        this.state = {
            isLoading: true
        };

        this.notificationSystem = React.createRef();

        this.requestId = this.props.match.params.requestId;
    }

    // Events.
    render()
    {
        return (
            <>
                <PageMain context={ this } title="فهرست STR" icon="license" isLoading={ this.state.isLoading } footerLinks={[{ href: "/", text: "صفحه اصلی" }]}
                    // topButtons={[
                    //     {
                    //         title: "دانلود STR",
                    //         url: GetUrl("downloadRegisterSTR/" + this.requestId),
                    //         color: "outline-success",
                    //         icon: "list-search",
                    //     },
                    //     {
                    //         title: "فهرست درخواست ثبت STR پولشویی",
                    //         url: GetUrl("registerStrListPage"),
                    //         color: "outline-primary",
                    //         icon: "list-search",
                    //     }
                    // ]}
                    >
                    <div className="card">
                        <div className="card-body">
                            <SimpleGrid context={ this } minHeightTableWrapper={ Constants.MinGridHeight } hasSearchBox hideExportButton
                                filterBgColor="primary" name="grRegisterStrList" title="لاگ درخواست های ثبت STR پولشویی" notificationSystem={ this.notificationSystem } enableAutoFetch
                                listApiUrl="/api/amls/RegisterSTRLog/SearchRegisterSTRLog" extraItemsSentToFetchData={{ Id: this.requestId }}
                                headers={[
                                    { title: "کد پرسنل درخواست دهنده", name: "requestorPersonCode" },
                                    { title: "تاریخ درخواست", name: "requestDateStr" },
                                    { title: "", name: "" },
                                    { title: "", name: "" },
                                    { title: "", name: "" },

                                ]} />
                        </div>
                        <div className="card-footer">
                            <div className="d-flex">
                                <a className="btn btn-outline-secendery ms-auto" onClick={ (e) => Backward(e) } href="/" title="بازگشت به صفحه قبل">
                                    بازگشت
                                <i className="ti ti-arrow-left ms-1"></i>
                                </a>
                            </div>
                        </div>
                    </div>
                </PageMain>
                <NotificationSystem ref={ this.notificationSystem } />
            </>
        );
    }
}
